(506, '2020-06-09T10:20:31.000Z', '', '', '', 'Helena', '5ed91ea922a7142f725a96f2', 'TRUE', 'So I have watched 30 mins worth of Hootsuite Youtube tutorials. We are linked to the twitter and facebook. to add linkedin we need to go to Manage Social Networks and Teams and click + Private Network. Once it is added it will come up on the main dashboard. You can only publish posts on Hootsuite and not Linkedin articles. Linkedin articles can only be published on Linkedin directly. So for the two articles written we can link to them in shorter posts that summarise the article itself. But that can only be done once they are published as articles on linkedin. I will make the productivity at home article a shorter post so that we have a mix of posts and articles.', 'text', '09-06-2020 10:20', 'Matthew', '5ed61c6522a71471af6b1572', '2020-06-09T10:20:31.000Z', '5ed91ea922a7142f725a96f2'),
(507, '2020-06-09T10:20:31.000Z', '', '', '', 'Helena', '5ed91ea922a7142f725a96f2', 'TRUE', 'So I have watched 30 mins worth of Hootsuite Youtube tutorials. We are linked to the twitter and facebook. to add linkedin we need to go to Manage Social Networks and Teams and click + Private Network. Once it is added it will come up on the main dashboard. You can only publish posts on Hootsuite and not Linkedin articles. Linkedin articles can only be published on Linkedin directly. So for the two articles written we can link to them in shorter posts that summarise the article itself. But that can only be done once they are published as articles on linkedin. I will make the productivity at home article a shorter post so that we have a mix of posts and articles.', 'text', '09-06-2020 10:20', 'Matthew', '5ed61c6522a71471af6b1572', '2020-06-09T10:20:31.000Z', '5ed61c6522a71471af6b1572'),
